var Ruler = {
    getSheetId : function(){
        return GameTool.createRand(1, 36);
    }, 

    getRuler : function(){

        var tableName = "Sheet";
        if(Global.level < 10){
            tableName = tableName + 7;
        }else if(Global.level >= 10 && Global.level < 20){
            tableName = tableName + 8;
        }else if(Global.level >= 20 && Global.level < 30){
            tableName = tableName + 9;
        }else if(Global.level >= 30 && Global.level < 40){
            tableName = tableName + 10;
        }else if(Global.level >= 40){
            tableName = tableName + 11;
        }
    
        var i = Ruler.getSheetId();
    
        var name = tableName + "_" + i;
        var data = RulerData[name];
        
        GameTool.debug("----------------------------------------------");
        GameTool.debug("get ruler:" + name);
        Global.fishX = data.length;
        Global.fishY = 8;
        return data;
    },
    
};


